import styled from "styled-components";
import MainSecIconsService from "./MainSecIconsService"


const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    padding: 2rem;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const Div = styled.div`
    max-width: 1080px;
    margin: 0 auto;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    flex-direction: column;
    gap: 3rem;
`

function Section06() {
    return (
        <SectionCTA>
            <Div>
                <MainSecIconsService />
            </Div>
        </SectionCTA>
    )
};

export default Section06;
